    const location = useLocation()
    let message =''
    if(location.state) {
        message = location.kepathnemey
    }
    console.log(location);

    return(
        <div>
            <h1>Meus Projetos</h1>
            {message && <Message msg = {message} type={"success"}/>}
        </div>
    )
}

export default Projects
